import React from "react";
import { useParams, Link, Outlet, useLocation } from "react-router-dom";

function Sucess() {
 
  const location = useLocation();

  const cost = location.state.totalcost;
  const count = location.state.counts;
  const theater = location.state.theatre;
  const time = location.state.time;
  const date = location.state.date;
  const name = location.state.name;
  const title = location.state.title;
  const app=location.state.payoption;
  const photo=location.state.photo;
  var num = cost / count;
  return (
    <>
      <div className="success-matter">
        <div>
          <img
            className=""
            src={`https://image.tmdb.org/t/p/w500/` + photo}
            height="400"
            width="400"
          />
        </div>
        <i className="checkmark">âœ“</i>
        <div>
          <h1>Success</h1>
          <p>Your Tickets are successfully booked </p>
          <p>
            Payment through: <span>{app}</span>
          </p>
        </div>
      </div>

      <div className="success-matter">
        <div></div>
      </div>
      <div class="success-feedback">
        <Link state={{ name: name }} to="/city">
          <button class="btn btn-primary w-10 py-2">Home</button>
        </Link>

        <Link
          state={{
            totalcost: cost,
            counts: count,
            theatre: theater,
            time: time,
            date: date,
            name: name,
          }}
          to="feedback"
        >
          <button class="btn btn-primary w-10 py-2">Feedback</button>
        </Link>
      </div>
      <Outlet />
    </>
  );
}
export default Sucess;
